import { Link } from "react-router-dom";

export const Root = () => {
    const {home, profile} = Routes
    return (
        <div>
        <Link to = "/home"> Go to Home </Link>
        <Link to = "/profile"> Go to Profile </Link>
        </div>
    );
};
